// Get an array of country codes from the source data
var countryCodes = Object.keys(com_c_vf);
var codeToIndex = {};
for (i in countryCodes) {
  codeToIndex[countryCodes[i]] = i;
}

/**
 * Initialize the final matrix
 * 0 = visa required
 * 1 = visa required but can be obtained on arrival (= visa free, kind of)
 * 2 = visa free but eTA required (= visa free, kind of)
 * 3 = visa not required (pure visa free)
 */
var data = [];
for (var i in countryCodes) {
  data[i] = new Array(countryCodes.length);
  data[i].fill(0);

  var passport = countryCodes[i];
  data[i][codeToIndex[passport]] = -1;

  var visa_free = com_c_vf[passport].split(',');
  var visa_on_arrival = com_c_voa[passport].split(',');
  var visa_eta = com_c_eta[passport].split(',');

  for (var j in visa_free) {
    data[i][codeToIndex[visa_free[j]]] = 3;
  }
  for (var j in visa_on_arrival) {
    data[i][codeToIndex[visa_on_arrival[j]]] = 1;
  }
  for (var j in visa_eta) {
    data[i][codeToIndex[visa_eta[j]]] = 2;
  }
}

// Uncomment below to use ISO Alpha 3 codes for the countries
 countryCodes = countryCodes.map(function(x) { return iso2to3[x]; });

